import React, { Component } from 'react';
import Avatar from '../Misc/Avatar';
import CheckInRow from './CheckinRow';

class UserPage extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {

    let checkinData = [
      {
        q: 'hi there this a q',
        type: StaticUserData.QTYPE_TEXT
      }
    ];
    let checkins = (
      <ul className="your-checkins">
        {checkinData.map(function (checkin, index) {
          return <CheckInRow
            q={checkin.q}
            trash={false}
            type={checkin.type}
          />;
        })}
      </ul>
    );

    let locationEl = null,
      bioEl = null,
      pronounEl = null;

    if (this.props.location != null) {
      locationEl =
        <div className="profile-location">
          <span className="jam checkicon jam-map-marker"></span>
          {this.props.location}
        </div>;
    }

    if (this.props.bio != null) {
      bioEl = <p className="profile-bio"> {this.props.bio}</p>
    }

    if (this.props.pronounEl != null) {
      pronounEl = <p className="profile-pronoun"> {this.props.pronounEl}</p>
    }


    return (
      <div className="modal user-page">
        <button className="close" onClick={() => this.props.closeUserPage()}>
          <span className="jam jam-close"></span>
        </button>

        <Avatar PpfURL={this.props.PpfURL}
          content={null
          }
        />

        <div className="profile-name">{this.props.name}</div>

        {locationEl}
        {pronounEl}
        {bioEl}

        <div className="action-buts">
          <button
            onClick={() => {
            }}>
            <span className="jam checkicon jam-message"></span>
            Add friend
          </button>

          <button
            onClick={() => {
            }}>
            <span className="jam checkicon jam-map-marker"></span>
            Message
          </button>

        </div>


        <div className="check-in-edit">
          <h2>Their check-in</h2>

          <h3>Check-in questions</h3>
          {checkins}
        </div>



        <button
          onClick={() => {
          }}>
          Report abuse
          </button>

      </div>
    );
  }
}

export default UserPage;
